,'Bilirubin is a breakdown product of hemoglobin. Total and direct bilirubin are usually measured to screen for or to monitor liver or gall bladder dysfunction.','en',1,'2006-06-02 00:00:00',NULL,NULL,'3a042893-b48e-11e6-94b7-0242ac130002'),(1292,1298,'Very Low Density Lipoprotein (VLDL) is one of three major lipoprotein particles.  VLDL contains the highest amount of triglyceride. Since VLDL contains most of the circulating triglyceride and since the compositions of the different particles are relatively constant, it is possible to estimate the amount of VLDL cholesterol by dividing the triglyceride value (in mg/dL) by 5.','en',1,'2006-06-02 00:00:00',NULL,NULL,'3a0428c4-b48e-11e6-94b7-0242ac130002'),(1293,1299,'To diagnose pancreatitis or other pancreatic diseases','en',1,'2006-06-05 00:00:00',NULL,NULL,'3a04290e-b48e-11e6-94b7-0242ac130002'),(1294,1293,'A chronic condition in which the lower esophageal sphincter allows gastric acids to reflux into the esophagus, causing heartburn, acid indigestion, and possible injury to the esophageal lining.','en',1,'2006-04-22 12:13:15',1,'2016-05-27 03:19:44','1294FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(1295,1301,'Descriptive term:  to discover or ascertain the existence, presence, or fact of.','en',1,'2006-06-05 00:00:00',NULL,NULL,'3a042979-b48e-11e6-94b7-0242ac130002'),(1296,1302,'Descriptive term:  unable to discover or ascertain the existence, presence, or fact of.','en',1,'2006-06-05 00:00:00',NULL,NULL,'3a0429a5-b48e-11e6-94b7-0242ac130002'),(1297,1303,'Descriptive term:  restrictive of action.','en',1,'2006-06-05 00:00:00',NULL,NULL,'3a0429d0-b48e-11e6-94b7-0242ac130002'),(1298,1305,'This is a qualitative result for the number of copies/ml of DNA/RNA in patients with HIV.','en',1,'2006-06-05 00:00:00',NULL,NULL,'3a0429fe-b48e-11e6-94b7-0242ac130002'),(1299,1306,'Descriptive Term:  beyond detectable limit.','en',1,'2006-06-05 00:00:00',NULL,NULL,'3a042a28-b48e-11e6-94b7-0242ac130002'),(1300,1307,'Mean platelet volume (MPV) is a machine-calculated measurement of the average size of your platelets. New platelets are larger, and an increased MPV occurs when increased numbers of platelets are being produced. MPV gives your doctor information about platelet production in your bone marrow.','en',1,'2006-06-06 00:00:00',NULL,NULL,'3a042b70-b48e-11e6-94b7-0242ac130002'),(1301,1308,'A measurement derived from the platelet count and the mean platelet volume.','en',1,'2006-06-06 00:00:00',NULL,NULL,'3a042ba3-b48e-11e6-94b7-0242ac130002'),(1302,1309,'Derived from direct flow cytometric measurement of platelet cell volume, it is increased in the presence of platelet anisocytosis.','en',1,'2006-06-06 00:00:00',NULL,NULL,'3a042c97-b48e-11e6-94b7-0242ac130002'),(1303,1310,'Percentage of t-cells which express the CD3 surface receptor.','en',1,'2006-06-06 00:00:00',NULL,NULL,'3a042cf2-b48e-11e6-94b7-0242ac130002'),(1304,1318,'Quantitative cut-off result for initial HIV screening test','en',1,'2006-06-06 00:00:00',NULL,NULL,'3a042f08-b48e-11e6-94b7-0242ac130002'),(1305,1319,'Immunology Test - CD45 plus lymphocyte count.','en',1,'2006-06-06 00:00:00',NULL,NULL,'3a042f62-b48e-11e6-94b7-0242ac130002'),(1306,1326,'Qualitative interpretation of rapid HIV screening test 2.','en',1,'2006-06-07 00:00:00',NULL,NULL,'3a042faa-b48e-11e6-94b7-0242ac130002'),(1307,1327,'Help determine if the bone marrow is responding adequately to the body?s need for RBCs and to help determine the cause of and classify different types of anemia.\r\n\r\nReticulocyte (%) = [Number of Reticulocytes / Number of Red Blood Cells] X 100','en',1,'2006-06-09 00:00:00',NULL,NULL,'3a042ff6-b48e-11e6-94b7-0242ac130002'),(1308,1328,'Reactive, or atypical lymphocytes are lymphocytes that become large as a result of antigen stimulation. Typically they can be more than 30 ','en',1,'2006-06-09 00:00:00',NULL,NULL,'3a0431a1-b48e-11e6-94b7-0242ac130002'),(1309,1330,'Absolute neutrophil count (ANC) is a measure of the number of neutrophil granulocytes (also known as polymorphonuclear cells, PMN\'s, polys, granulocytes, segmented neutrophils or segs) present in the blood. Neutrophils are a type of white blood cell that fights against infection.\r\n\r\nANC = (%neutrophils + %bands) x WBC','en',1,'2006-06-09 00:00:00',NULL,NULL,'3a0431ee-b48e-11e6-94b7-0242ac130002'),(1310,1331,'A monocyte count is part of a complete blood count and is expressed by absolute numbers.  Increase a monocyte count include: - chronic inflammation - stress response - hyperadrenocorticism - immune mediated disease - pyogranulomatous disease - necrosis - red cell regeneration.\r\n','en',1,'2006-06-09 00:00:00',NULL,NULL,'3a043388-b48e-11e6-94b7-0242ac130002'),(1311,1332,'Eosinophil granulocytes, commonly referred to as eosinophils (or less commonly as acidophils), are white blood cells that are responsible for combating infection by parasites in the body.\r\n\r\n','en',1,'2006-06-09 00:00:00',NULL,NULL,'3a04343a-b48e-11e6-94b7-0242ac130002'),(1312,1333,'Basophils are the least common of the granulocytes, representing about 0.5% to 1% of circulating leukocytes. ','en',1,'2006-06-09 00:00:00',NULL,NULL,'3a043654-b48e-11e6-94b7-0242ac130002'),(1313,1334,'Reactive, or atypical lymphocytes are lymphocytes that become large as a result of antigen stimulation. Typically they can be more than 30 ','en',1,'2006-06-09 00:00:00',NULL,NULL,'3a0436e8-b48e-11e6-94b7-0242ac130002'),(1314,1336,'Type of white blood cell which forms an early line of defence against bacterial infections by using microscopic exam','en',1,'2006-06-09 00:00:00',NULL,NULL,'3a0438b5-b48e-11e6-94b7-0242ac130002'),(1315,1337,'Immature neutrophils with a crescent shaped nucleus, bands are normal in the circulation in small numbers. If there is a percentage increase of them, there is said to be a left shift. This may happen when an acute infection stimulates increased neutrophils production.  This is a microscopic exam.','en',1,'2006-06-09 00:00:00',NULL,NULL,'3a043934-b48e-11e6-94b7-0242ac130002'),(1316,1338,'Agranulocytic leukocyte that normally makes up about 25% of the total white blood cell count but increases in the presence of infection.  This is a microscopic exam.','en',1,'2006-06-09 00:00:00',NULL,NULL,'3a043b34-b48e-11e6-94b7-0242ac130002'),(1317,1339,'Large, circulating, phagocytic white blood cells, having a single well-defined nucleus and very fine granulation in the cytoplasm. Monocytes constitute from 3 to 8 percent of the white blood cells in humans.  This is a microscopic exam.','en',1,'2006-06-09 00:00:00',NULL,NULL,'3a043d59-b48e-11e6-94b7-0242ac130002'),(1318,1340,'A type of white blood cell found in vertebrate blood, containing cytoplasmic granules that are easily stained by eosin or other acid dyes.  This is a microscopic exam.','en',1,'2006-06-09 00:00:00',NULL,NULL,'3a043f0f-b48e-11e6-94b7-0242ac130002'),(1319,1341,'Type of leukocyte, with coarse granules that stain blue when exposed to a basic dye. Basophils normally constitute 1% or less of the total white blood cell count but may increase or decrease in certain diseases.  This is a microscopic exam.','en',1,'2006-06-09 00:00:00',NULL,NULL,'3a0440c9-b48e-11e6-94b7-0242ac130002'),(1320,1342,'Body Mass Index (BMI) is a relationship between weight and height that is associated with body fat and health risk.\r\n\r\nThe equation is BMI = body weight in kilograms/height in meters squared.','en',1,'2006-07-13 00:00:00',NULL,NULL,'3a046dfc-b48e-11e6-94b7-0242ac130002'),(1321,1343,'MUAC is the circumference of the left upper arm, measured at the mid-point between the tip of the shoulder and the tip of the elbow.  MUAC is useful for the assessment of nutritional status.','en',1,'2006-07-13 00:00:00',NULL,NULL,'3a046f80-b48e-11e6-94b7-0242ac130002'),(1322,1344,'Anatomic location.','en',1,'2006-07-13 00:00:00',NULL,NULL,'3a04704d-b48e-11e6-94b7-0242ac130002'),(1323,1345,'Anatomic location.','en',1,'2006-07-13 00:00:00',NULL,NULL,'3a04710d-b48e-11e6-94b7-0242ac130002'),(1324,1346,'