of the conjunctiva and later of the cornea (XEROPHTHALMIA). Vitamin A deficiency is a very common problem worldwide, particularly in developing countries as a consequence of famine or shortages of vitamin A-rich foods. In the United States it is found among the urban poor, the elderly, alcoholics, and patients with malabsorption. (From Cecil Textbook of Medicine, 19th ed, p1179)','en',1,'2007-10-18 04:28:24',1,NULL,'6890FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6933,123123,'Inflammation, often mild, of the conjunctiva caused by a variety of viral agents. Conjunctival involvement may be part of a systemic infection.','en',1,'2007-10-18 04:28:24',1,NULL,'6933FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7066,123529,'DEF: Discharge of purulent fluid from the urethra. DESC: Commonly caused by Gonorrhea and/or chlamydia. REF: Merck Manual','en',1,'2007-10-18 04:28:24',1,'2016-05-21 14:00:44','7066FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7067,123529,'ECOULEMENT URETRAL','fr',1,'2007-07-13 14:56:43',1,'2016-05-21 14:00:44','7067FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7275,124129,'Infection with nematodes of the genus TRICHURIS, formerly called Trichocephalus.','en',1,'2007-10-18 04:28:24',1,NULL,'7275FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7773,126127,'Expulsion of the products of conception before the completion of gestation without deliberate interference.','en',1,'2007-10-18 04:28:24',1,'2016-07-10 02:55:15','7773FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7801,126208,'Congenital defects of closure of one or more vertebral arches, which may be associated with malformations of the spinal cord, nerve roots, congenital fibrous bands, lipomas, and congenital cysts. These malformations range from mild (e.g., SPINA BIFIDA OCCULTA) to severe, including rachischisis where there is complete failure of neural tube and spinal cord fusion, resulting in exposure of the spinal cord at the surface. Spinal dysraphism includes all forms of spina bifida. The open form is called SPINA BIFIDA CYSTICA and the closed form is SPINA BIFIDA OCCULTA. (From Joynt, Clinical Neurology, 1992, Ch55, p34)','en',1,'2007-10-18 04:28:24',1,NULL,'7801FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7914,126558,'An infectious disease caused by bacteria of the genus SHIGELLA. This condition is characterized by intestinal pain and diarrhea.','en',1,'2007-10-18 04:28:24',1,NULL,'7914FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(8328,127579,'The persistence to perform a learned behavior (facts or experiences) after an interval has elapsed in which there has been no performance or practice of the behavior.','en',1,'2007-10-18 04:28:24',1,NULL,'8328FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(8452,127990,'Fever in which the etiology cannot be ascertained.','en',1,'2007-11-02 20:16:08',1,'2016-05-27 02:00:14','8452FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(8508,128126,'Bronchial hemorrhage manifested with spitting of blood.','en',1,'2007-10-18 04:28:24',1,NULL,'8508FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9072,129566,'A developmental anomaly characterized by the presence of more than five fingers on the hand or more than five toes on the foot in primates. In non-primate vertebrates, it refers to the presence of more than the normal number of toes on the forelimb or hindlimb. (Dorland, 27th ed; Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9072FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9467,131113,'Inflammation of the middle ear.','en',1,'2007-11-02 20:16:26',1,NULL,'9467FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9468,131113,'Otite moyenne','fr',1,'2007-09-06 08:51:25',1,NULL,'9468FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9762,132636,'A syndrome produced by severe protein deficiency, characterized by retarded growth, changes in skin and hair pigment, edema, and pathologic changes in the liver, including fatty infiltration, necrosis, and fibrosis. The word is a local name in Gold Coast, Africa, meaning \"displaced child\". Although first reported from Africa, kwashiorkor is now known throughout the world, but mainly in the tropics and subtropics. It is considered to be related to marasmus. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9762FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9763,132636,'MARASME','fr',1,'2007-07-13 13:53:41',1,NULL,'9763FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10003,133414,'Acute conjunctival inflammation in the newborn, usually caused by maternal gonococcal infection. The baby\'s eyes are contaminated during passage through the birth canal.','en',1,'2007-10-18 04:28:24',1,'2014-12-09 02:49:00','10003FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10318,134213,'Abnormal smallness of the head, usually associated with mental retardation. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,'2016-08-01 19:24:17','10318FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10354,134337,'Psychiatric illness or diseases manifested by breakdowns in the adaptational process expressed primarily as abnormalities of thought, feeling, and behavior producing either distress or impairment of function.','en',1,'2007-10-18 04:28:24',1,'2015-11-04 04:38:38','10354FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10416,134561,'A highly contagious infectious disease caused by MORBILLIVIRUS, common among children but also seen in the nonimmune of any age, in which the virus enters the respiratory tract via droplet nuclei and multiplies in the epithelial cells, spreading throughout the reticuloendothelial system. (From Dorland, 27th ed)','en',1,'2007-11-02 20:12:00',1,'2016-07-29 22:53:57','10416FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(10847,135462,'Subacute inflammation of the inguinal lymph glands caused by certain immunotypes of CHLAMYDIA TRACHOMATIS. It is a sexually transmitted disease in the U.S. but is more widespread in developing countries. It is distinguished from granuloma venereum (see GRANULOMA INGUINALE), which is caused by Calymmatobacterium granulomatis.','en',1,'2007-10-18 04:28:24',1,NULL,'10847FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(11171,136443,'DEF:Yellow pigmentation of the skin and sclerae due to a raised level of plasma bilirubin. DESC: classified by the type of circulating bilirubin (conjugated or uncongugated). REF OXFORD CLINICAL MEDICINE','en',1,'2007-11-02 20:02:04',1,'2015-12-31 16:44:51','11171FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(11247,136677,'Infections of the intestines with a parasite. They are caused most commonly by intestinal nematodes (roundworms) and cestodes (tapeworms). (From Merck Manual, 15th ed; Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,'2015-11-03 03:02:46','11247FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(11276,136758,'Uterine bleeding, usually irregular or acyclic, between periods.','en',1,'2007-10-18 04:28:24',1,NULL,'11276FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(11369,137293,'Skin diseases caused by bacteria, fungi, parasites, or viruses.','en',1,'2007-10-18 04:28:24',1,NULL,'11369FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(11404,137352,'A genus of large tapeworms.','en',1,'2007-10-18 04:28:24',1,NULL,'11404FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(11406,137355,'Infection with nematodes of the genus STRONGYLOIDES. The presence of larvae may produce pneumonitis and the presence of adult worms in the intestine could lead to moderate to severe diarrhea.','en',1,'2007-10-18 04:28:24',1,NULL,'11406FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(11759,138291,'Abnormally increased content of sugar in the blood. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,'2016-06-24 02:01:09','11759FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(11981,138706,'A group of acute infections caused by herpes simplex virus type 1 or type 2 that is characterized by the development of one or more small fluid-filled vesicles with a raised erythematous base on the skin or mucous membrane. It occurs as a primary infection or recurs due to a reactivation of a latent infection. (Dorland, 27th ed.)','en',1,'2007-10-18 04:28:24',1,'2012-06-06 18:30:47','11981FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(12058,138849,'Varicosities of the hemorrhoidal venous plexuses.','en',1,'2007-10-18 04:28:24',1,'2015-11-04 04:07:14','12058FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(12062,138868,'Any of various disorders marked by inflammation of the intestines, especially of the colon, and attended by pain in the abdomen, tenesmus, and frequent stools containing blood and mucus. Causes include chemical irritants, bacteria, protozoa, or parasitic worms. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,'2016-05-25 20:42:13','12062FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(12141,139084,'Pain in the cranial region that may occur as an isolated and benign symptom or as a manifestation of a wide variety of conditions including SUBARACHNOID HEMORRHAGE; CRANIOCEREBRAL TRAUMA; CENTRAL NERVOUS SYSTEM INFECTIONS; INTRACRANIAL HYPERTENSION; and other disorders. In general, recurrent headaches that are not associated with a primary disease process are referred to as HEADACHE DISORDERS (e.g., MIGRAINE).','en',1,'2007-11-02 20:20:16',1,'2015-11-05 01:38:54','12141FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(12204,139277,'Anogenital ulcers caused by Calymmatobacterium granulomatis as distinguished from lymphogranuloma inguinale (see LYMPHOGRANULOMA VENEREUM) caused by CHLAMYDIA TRACHOMATIS. Diagnosis is made by demonstration of typical intracellular Donovan bodies in crushed-tissue smears.','en',1,'2007-10-18 04:28:24',1,NULL,'12204FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(12250,139355,'The presence of glucose in the urine, especially the excretion of an abnormally large amount of sugar (glucose) in the urine. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12250FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(12515,140039,'A transient reddening of the face that may be due to fever, certain drugs, exertion, stress, or a disease process.','en',1,'2007-10-18 04:28:24',1,NULL,'12515FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(12569,140238,'An abnormal elevation of body temperature, usually as a result of a pathologic process.','en',1,'2007-11-02 19:43:33',1,'2015-11-05 01:37:17','12569FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(12730,140987,'Persistently high arterial blood pressure. Currently accepted threshold levels are 140 mm Hg